import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import sweetalert from 'sweetalert';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <div><App /></div>
  </React.StrictMode>, document.getElementById('root')
);
